import React, { useState, useEffect } from 'react';

function App() {
  const [usersQuery1, setUsersQuery1] = useState([]);
  const [usersQuery2, setUsersQuery2] = useState([]);
  const [usersQuery3, setUsersQuery3] = useState([]);
  const [usersQuery4, setUsersQuery4] = useState([]);
  const [topCities, setTopCities] = useState([]);

  useEffect(() => {
    async function fetchData() {
      // Fetch data for query 1
      const res1 = await fetch('/api/users/query1');
      const data1 = await res1.json();
      setUsersQuery1(data1);

      // Fetch data for query 2
      const res2 = await fetch('/api/users/query2');
      const data2 = await res2.json();
      setUsersQuery2(data2);

      // Fetch data for query 3
      const res3 = await fetch('/api/users/query3');
      const data3 = await res3.json();
      setUsersQuery3(data3);

      // Fetch data for query 4
      const res4 = await fetch('/api/users/query4');
      const data4 = await res4.json();
      setUsersQuery4(data4);

      // Fetch data for query 5
      const res5 = await fetch('/api/cities/top');
      const data5 = await res5.json();
      setTopCities(data5);
    }
    fetchData();
  }, []);

  return (
    <div>
      <h1>Users with income lower than $5 USD and have a car of brand BMW or Mercedes:</h1>
      <table>
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Income</th>
            <th>Car Brand</th>
            <th>Car Model</th>
          </tr>
        </thead>
        <tbody>
          {usersQuery1.map(user => (
            <tr key={user._id}>
              <td>{user.first_name}</td>
              <td>{user.last_name}</td>
              <td>{user.email}</td>
              <td>{user.income}</td>
              <td>{user.car.brand}</td>
              <td>{user.car.model}</td>
            </tr>
          ))}
        </tbody>
      </table>
  
      <h1>Male users with phone price greater than 10,000:</h1>
      <table>
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Phone Price</th>
            <th>Phone Brand</th>
            <th>Gender</th>
          </tr>
        </thead>
        <tbody>
          {usersQuery2.map(user => (
            <tr key={user._id}>
              <td>{user.first_name}</td>
              <td>{user.last_name}</td>
              <td>{user.email}</td>
              <td>{user.phone.price}</td>
              <td>{user.phone.brand}</td>
              <td>{user.gender}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h1>Male users with phone price greater than 10,000:</h1>
      <table>
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Phone Price</th>
            <th>Phone Brand</th>
            <th>Gender</th>
          </tr>
        </thead>
        <tbody>
          {usersQuery2.map(user => (
            <tr key={user._id}>
              <td>{user.first_name}</td>
              <td>{user.last_name}</td>
              <td>{user.email}</td>
              <td>{user.phone.price}</td>
              <td>{user.phone.brand}</td>
              <td>{user.gender}</td>
            </tr>
          ))}
        </tbody>
      </table>
           
      <h1>Male users with phone price greater than 10,000:</h1>
      <table>
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Phone Price</th>
            <th>Phone Brand</th>
            <th>Gender</th>
          </tr>
        </thead>
        <tbody>
          {usersQuery2.map(user => (
            <tr key={user._id}>
              <td>{user.first_name}</td>
              <td>{user.last_name}</td>
              <td>{user.email}</td>
              <td>{user.phone.price}</td>
              <td>{user.phone.brand}</td>
              <td>{user.gender}</td>
            </tr>
          ))}
        </tbody>
      </table>
      </div>

  );
}
